  false,\n\t\"url\": null,\n\t\"notes\": \"This project is a cooperative effort among
  the National Ocean Service, National Centers for Coastal Ocean Science, Center for
  Coastal Monitoring and Assessment; the University of Hawaii; BAE Systems Spectral
  Solutions; and Analytical Laboratories of Hawaii, LLC. The goal of the work was
  to incorporate previously developed mapping methods to produce coral reef habitat
  maps for American Samoa, Guam and the Commonwealth of the Northern Mariana Islands.
  GPS field observations were used to establish the thematic accuracy of this thematic
  product. 1113 benthic habitat characterizations were completed for this work.\",\n\t\"owner_org\":
